import React from 'react';
import ros from '../assets/images/ros.png';
function Ros(){
    return(
        <div className="card">
        <h3>ROS turtlesim teleop</h3>
        <img className="site-image" src={ros} alt="img" />
            <p><br></br>Developing a package in Python that is compatible with ROS to control the turtle by teleoperation using keyboard.</p>
            </div>
    );
}

export default Ros;
